import React from "react";
import ExpenceItem from "./ExpenseItem";
import Card from "../UI/Card";

import "./Expenses.css";

const Expences = ({ expenses }) => {
  return (
    <div>
      <ExpensesFilter />

      <Card className="expenses">
        {expenses.map((expence) => (
          <ExpenceItem
            key={expence.id}
            title={expence.title}
            amount={expence.amount}
            date={expence.date}
          />
        ))}
      </Card>
    </div>
  );
};

export default Expences;
